import React from "react";

import {
	Widget,
	WidgetTitulo,
	WidgetLista,
	WidgetListaItem,
	WidgetUsuarioImagem,
	WidgetUsuarioNome,
	WidgetUsuarioCargo,
	WidgetBotao,
} from "./WidgetPequenoElementos";

import VisibilityIcon from "@material-ui/icons/Visibility";

const WidgetPequeno = () => {
	return (
		<>
			<Widget>
				<WidgetTitulo>Novos Membros</WidgetTitulo>
				<WidgetLista>
					<WidgetListaItem>
						<WidgetUsuarioImagem />
						<WidgetUsuarioNome>Ramon Rodrigues</WidgetUsuarioNome>

						<WidgetUsuarioCargo>Desenvolvedor Web</WidgetUsuarioCargo>

						<WidgetBotao></WidgetBotao>
					</WidgetListaItem>
				</WidgetLista>
			</Widget>
		</>
	);
};

export default WidgetPequeno;
